    calls.filter((i) => i.status === StatusCallType.DIALING).length > 0;
  const ringing =
    calls.filter((i) => i.status === StatusCallType.RINGING).length > 0;

  return (
    <>
      <div className="h6 mb-3">{t(`New Calls`) + ` (${callList.length})`}</div>
      {callList.map((call, i) => (
        <>
          <CardCall call={call} last={callList.length === i + 1} key={i} />
          <IncomingCall call={call} i={i} />
        </>
      ))}
      {ringing && (
        <audio autoPlay loop src={require("../assets/audio/ringing.mp3")} />
      )}
      {dialing && (
        <audio autoPlay loop src={require("../assets/audio/ring.mp3")} />
      )}
    </>
  );
  */
  return <></>;
};

export default NewCalls;
